import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import styled from 'styled-components';
import { useParams } from "react-router-dom";
const Back = styled.div`
    width: 100%;
    height: 100%;
    background: #F1EBE3;
    margin-top: -50px;
`;
const Container = styled.div`
    font-family: Calibri, Candara, Segoe, "Segoe UI", Optima, Arial, sans-serif;
    color: #000000;
    text-align: center;
    padding-bottom: 60px;
    padding-top: 50px;
    @media only all and (max-width: 570px) {
        margin-top: 95px;
    }
    flex: 0 0 66.666667%;
    max-width: 66.666667%;
    position: relative;
    width: 100%;
    display: flex;
    flex-wrap: wrap;
    margin-left: auto;
    margin-right: auto;    
    @media only all and (max-width: 1680px) {
        max-width: 80%!important;
        flex: 0 0 80%!important;
    }
    @media only all and (max-width: 1440px) {
    	max-width: 100%!important;
    	flex: 0 0 100%!important;
    }
`;
const Section = styled.div`
    color: #000000;
    @media only all and (max-width: 570px) {
        margin-left: 20px;
        margin-right: 20px;
        margin-top: 95px;
    }
`;
const TitleStyle = styled.div`
    font-size: 60px;
    text-transform: uppercase;
    font-family: 'Poppins', sans-serif;
    color: #8D120C;
    height: 60px;
    font-weight: 900;
    margin-bottom: 10px;
    @media only all and (max-width: 570px) {
        font-size: 40px;
    }
`;
const Subtitle = styled.div`
    font-size: 20px;
    & > span{
        color: #8D120C; 
    }
    @media only all and (max-width: 570px) {
        font-size: 18px;
    }
`;
export default function Details_Long() {
    const { id } = useParams();
    const [dataset, setData] = useState([]);
    async function getData() {
        try {
            const res = await fetch(`/api/car/lungo/details/${id}/`);
            const data = await res.json();
            data.map((post) => setData(post));
        } catch (e) {
            console.log(e);
        }
    }
    useEffect(() => {
        getData();
    }, []);
    return(
        <>
        <Back>
            <Container>
                <Section className="text-center">
                    <TitleStyle>Palponauto</TitleStyle>
                    <Subtitle>noleggio <span>lungo</span> e <span>breve</span> termine</Subtitle>
                </Section>
                <h1> { dataset.nome }</h1>
            </Container>
        </Back>
        </>
    );
}
